  "title": {
    "nb": "N50 Kartdata med svensk koding lik Vägkartan."
  },
  "description": {
    "nb": "Datasett lik produktet N50 Kartdata, men har svensk koding i tillegg til den norske kodingen. Kodingen tilsvarer den man finner på datasettet Vägkarten.\nN50 Kartdata er etablert for presentasjon i målestokk 1:50 000. Produktet har et innhold som tilsvarer papirkartserien Norge 1:50 000 med unntak av bathymetri (dybder). \nFormat: ESRI filgeodatabase. projeksjon: UTM sone 33N, Euref89.\n\nKartverket og Lantmäteriet i Sverige inngikk våren 2015 en samarbeidsavtale om å dele geodata mellom myndigheter, fylker og kommuner på begge sider av den norsk-svenske grensen. Disse dataene er et resultat av dette samarbeidet."
  },
  "descriptionFormatted": {
    "nb": "Datasett lik produktet N50 Kartdata, men har svensk koding i tillegg til den norske kodingen. Kodingen tilsvarer den man finner på datasettet Vägkarten.\nN50 Kartdata er etablert for presentasjon i målestokk 1:50 000. Produktet har et innhold som tilsvarer papirkartserien Norge 1:50 000 med unntak av bathymetri (dybder). \nFormat: ESRI filgeodatabase. projeksjon: UTM sone 33N, Euref89.\n\nKartverket og Lantmäteriet i Sverige inngikk våren 2015 en samarbeidsavtale om å dele geodata mellom myndigheter, fylker og kommuner på begge sider av den norsk-svenske grensen. Disse dataene er et resultat av dette samarbeidet."
  },
