    "nb": "Landsdekkende arealdekkekart for Norge som inngår i det europeiske kartprogrammet CORINE Land Cover (CLC). CLC består av nasjonale arealdekkedatasett som integreres i et sømløst arealdekkekart over Europa. CLC er kun egnet for visualisering.\nEgenskap som skal brukes til å fremstille kartlaget heter CLC00_KODE. Areal i kvadratmeter er oppført i egenskap AREA_C. Fremstillingsmetoden i Norge avviker noe fra den europeiske standarden."
