  "description": {
    "nb": "Datasettet inneholder stedfestet informasjon om arter observert eller funnet i Norge. Funndataene følger datastandarden Darwin Core Archive (se http://rs.tdwg.org/dwc/ for detaljer). Datasettet inneholder også informasjon om artenes rødlistekategori (informasjon om arten er truet eller rødlistet) og fremmedeartskategori (informasjon om artenes økologisk risiko). \n\nDatasettet oppdateres kontinuerlig og inneholder per september 2016 over 23 millioner funn av 32 200 ulike arter."
