  "title": {
    "nb": "Kulturminner - Sikringssoner"
  },
  "description": {
    "nb": "Kulturminnelovens § 6 beskriver sikringssoner på følgende vis: ”Med til et automatisk fredet kulturminne som nevnt i § 4, hører et område rundt dets synlige eller kjente ytterkant så langt det er nødvendig for å verne det mot tiltak som nevnt i § 3 første ledd. Området fastsettes særskilt av vedkommende myndighet etter loven.”\n\nSikringssonen skal beskytte det automatisk fredete kulturminnets integritet og plassering i landskapet og hindre inngrep og utilbørlig skjemming som nevnt i kml. § 3 første ledd. Sikringssonen utgjør en integrert del av det automatisk fredete kulturminnet og vil måtte vurderes sammen med dette ved spørsmål om dispensasjon."
  },
