  "title": {
    "nb": "Reindrift - Årstidsbeite - Sommerbeite"
  },
  "description": {
    "nb": "Den sesongmessige arealbruken er delt inn i fem årstider, som igjen er delt inn i to kategorier etter funksjon og beiteintensitet. Sommerbeite er områder som reinen bruker på sommeren. Sommerbeite deles igjen i kategorier: Sommerbeite 1 - Høysommerland, sentrale deler som regel over skoggrensa, der reinen oppholder seg midtsommers og får dekket sine behov for beite, ro, avkjøling og minst mulig insektsplage innenfor korte avstander. Sommerbeite 2 - Lavereliggende sommerland, mindre sentrale og/eller mindre intenst brukte områder. Beitebruken vil variere fra år til år innen samme område. Inndelingssystemet gjelder reindrifta i hele landet. De årlige variasjonene i bl.a. vær og beiteforhold gjør at årstidsavgrensningene må bli noe vide og omtrentlige."
  },
