  "title": {
    "nb": "Reindrift - Årstidsbeite - Vinterbeite"
  },
  "description": {
    "nb": "Den sesongmessige arealbruken er delt inn i fem årstider, som igjen er delt inn i to kategorier etter funksjon og beiteintensitet. Vinterbeiteområde viser områder som reinen bruker på vinteren. Vinterbeiteområdene er delt inn i 2: Vinterbeite 1 - Senvinterland, intensivt brukte områder som normalt er mest sikre mot store snømengder og nedising på midt- og senvinteren. Vinterbeite 2 - Tidlig benyttede og ofte lavere beliggende vinterområder, som regel mindre intensivt brukte. Beitebruken vil variere fra år til år innen samme område. Inndelingssystemet gjelder reindrifta i hele landet. De årlige variasjonene i bl.a. vær og beiteforhold gjør at årstidsavgrensningene må bli noe vide og omtrentlige."
  },
