  "title": {
    "nb": "Dybdedata - terrengmodeller 50 meters grid"
  },
  "description": {
    "nb": "Datasettet viser terrengvariasjoner på havbunnen. Terrengmodellene har blitt produsert av innsamlede sjømålingsdata av høy kvalitet. Dekningsområdet kystnært inkluderer store deler av Hordaland og ellers utvalgte områder i Sogn og Fjordane, Møre og Romsdal og Trøndelag. De nordligste fylkene har den beste dekningen med relativt heldekkende dekning nord for 67 grader. For havområdene er dekningen i stor grad avhengig av kartleggingen i forbindelse med MAREANO programmet. MAREANO har kartlagt havområdene utenfor Møre og Romsdal, Trøndelag, Nordland, Troms, Finnmark, Barentshavet øst og ellers utvalgte områder ved Svalbard. Dekningsområdet utvides kontinuerlig etterhvert som nye områder blir kartlagt. Oppløsning på terrengmodellene er 50m x 50m."
  },
