  "description": {
    "nb": "Karttjenesten viser hvor vannverkene tar ut vann fra innsjøer, bekker eller grunnvann. Det forutsettes at vannverkene har rapportert koordinatene til Mattilsynet. Vannverk som fremkommer er primært de som forsyner 50 personer eller flere med vann. I tillegg inngår alle kommunalt eide virksomheter med egen vannforsyning uavhengig av størrelse.\n\nFor å unngå å gi for presis informasjon om stedet blir informasjonen borte når det zoom\u0027es inn mer enn det som Mattilsynet har satt som grense.\n\nDet er bare hovedkilder som angis i karttjenesten. Ved å klikke på de enkelte punktene vil man få informasjon om navn på vannverk og innrapporterte analysedata for råvannet."
