  "title": {
    "nb": "SAT-SKOG - Volum Furu"
  },
  "description": {
    "nb": "SAT-SKOG er et oversiktskart over skogressursene og gir informasjon om treslag, volum og alder. Tolkingen er basert på bildedata fra jordobservasjonssatellittene Landsat 5 og -7. Bildene sammenstilles med prøveflater fra Landsskogtakseringen, kartdata fra AR5 og terrengmodellen DTM. \nVolum gran er det totale volumet summert over alle furutrærne på et areal. I SAT-SKOG har vi valgt å vise kart med tre volumklasser."
  },
  "descriptionFormatted": {
