  "title": {
    "nb": "Naturtyper i Norge - Landskap"
  },
  "description": {
    "nb": "OBS! Ny heldekkende versjon lanseres april 2019. \n\nNiN landskap er et system for beskrivelse av landskapsmessig variasjon som forholder seg til definisjonene i den europeiske landskapskonvensjonen og i naturmangfoldloven. NiN landskap er en del av Artsdatabanken sitt typesystem «Natur i Norge (NiN)». Kartleggingsmetodikken er utviklet for Nordland fylke, og standarden er utviklet etter et pilotprosjekt i Nordland fylke. Systemet inneholder standardisert metodikk for avgrensing og typeinndeling av landskap. Landskapsnivået i NiN er tilpasset kartlegging i målestokk 1:50 000. Landskapstypeinndelingen i NiN omfatter alle landskap fra naturlandskap, via jordbrukslandskap til bylandskapet. På grunnlag av digitale terrengformanalyser er det laget standardiserte kriterier for inndeling i hovedtyper og grupper av hovedtyper, som fanger opp variasjonen i landskapet på grov skala. Videre er det utarbeidet en typeinndeling for å adressere landskapsvariasjon i finere skala basert på variasjon i landskapets innhold og egenskaper. Variasjon i landskapet langs ti gradienter danner grunnlag for denne inndelingen."
  },
