    "en": "Road traffic information"
  },
  "description": {
    "nb": "Hendelsespublikasjonen inneholder informasjon om hendelser på eller langs veg som påvirker trafikkavviklingen og som kan medføre forsinkelser eller forhøyet ulykkesrisiko. Eksempler på slike hendelser kan være veiarbeid, stengninger eller annen midlertidig trafikkregulering, trafikkuhell, uvær, ras, flom, o.l. \r\n\r\nMan må bestille tilgang til statens vegvesen sin DATEX node før man kan kople seg på publikasjonen.\r\n",
    "en": "The publication contains information about situations occurred on the road network in Norway in addition to measures taken. This can e.g. be information about road works, road closures, accidents, redirections of traffic etc. \r\nThe situation publications are published continuously.\r\n\r\nYou have to request a user account before you connect to the publication."
  },
