    "en": "The publication contains information about situations occurred on the road network in Norway in addition to measures taken. This can e.g. be information about road works, road closures, accidents, redirections of traffic etc. \r\nThe situation publications are published continuously.\r\n\r\nYou have to request a user account before you connect to the publication."
