  "description": {
    "nb": "Denne publikasjonen dekker statiske data om vegnettet som type veg, høyde, bredde, bro, tunnel, inklusive sykkel- og gangveger. I tillegg vil du finne datasett om reguleringer som vegoppmerking, fartsgrenser og omkjøringer. ",
    "en": "This publication covers all static data about the road network of Norway such as road reference, hight restrictions, road width, bridges and tunnels. In addition it covers datasets such as road regulations, speed limits, diversion routes etc."
  },
