  "title": {
    "nb": "Vrakmeldinger"
  },
  "description": {
    "nb": "Opplysninger om vrakmeldinger. Biloppsamlingsplassene mottar kjøretøy som skal vrakes, de sender meldingen om dette gjennom vrakmeldingssystemet VRAKSYS. \nKjøretøy som vrakes skal få utbetalt en vrakpant fra staten. Offentlig godkjent biloppsamlingsplass får driftstilskudd. Skatteetaten håndterer ordningen på vegne av Miljødirektoratet."
  },
  "descriptionFormatted": {
    "nb": "Opplysninger om vrakmeldinger. Biloppsamlingsplassene mottar kjøretøy som skal vrakes, de sender meldingen om dette gjennom vrakmeldingssystemet VRAKSYS. \nKjøretøy som vrakes skal få utbetalt en vrakpant fra staten. Offentlig godkjent biloppsamlingsplass får driftstilskudd. Skatteetaten håndterer ordningen på vegne av Miljødirektoratet."
  },
  "objective": {
    "nb": "Formålet er å motta opplysninger om vrakede kjøretøy, for å kunne utbetale vrakpant og driftstilskudd på kjøretøy, samt oppdatere Statens vegvesens kjøretøyregister med vrakede kjøretøy. "
  },
