  "title": {
    "nb": "A-meldingen"
  },
  "description": {
    "nb": "Rapportering av lønns- og ansettelsesforhold til Skatteetaten, NAV og Statistisk sentralbyrå (SSB) er samlet i a-meldingen og sendes inn hver måned av alle som utbetaler lønn, pensjon og andre ytelser. A-meldingen inneholder opplysninger om lønn ytelser, i tillegg til status på alle arbeidsforhold."
  },
  "descriptionFormatted": {
    "nb": "Rapportering av lønns- og ansettelsesforhold til Skatteetaten, NAV og Statistisk sentralbyrå (SSB) er samlet i a-meldingen og sendes inn hver måned av alle som utbetaler lønn, pensjon og andre ytelser. A-meldingen inneholder opplysninger om lønn ytelser, i tillegg til status på alle arbeidsforhold."
  },
  "objective": {
    "nb": "Formålet med a-meldingen er å legge til rette for at arbeidsgivere mv. effektivt kan oppfylle sine plikter til å gi opplysninger om enkeltpersoners (inntektsmottakeres) inntekts- og arbeidsforhold og skattetrekkopplysninger, og å gi offentlige etater tilgang til opplysningene innrapportert fra arbeidsgiver."
  },
