  "title": {
    "nb": "Kolumbus Real Time Open Data "
  },
  "description": {
    "nb": "Kolumbus Real Time Open Data is standardized on SIRI (Service Interface for Real Time Information) which is a web based XML protocol to allow distributed computers to exchange real time information about public transport services and vehicles. SIRI is a CEN technical specification, and is based on the Transmodel abstract model for public transport information, and comprises a general purpose model, and an XML schema for public transport information.For more information, see https://en.wikipedia.org/wiki/Service_Interface_for_Real_Time_InformationKolumbus has implemented three SIRI interfaces:SIRI VM – Vehicle Monitoring (positioning and status for all buses)SIRI SM – Stop Monitoring (departure prognosis for individual bus stops)SIRI SX – Situation Exchange (deviation messages)Kolumbus currently support the SIRI version 1.4. There are approximately 400 buses that operate and have real-time information in Rogaland.For technical developer details and examples, see https://www.kolumbus.no/siri/"
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eKolumbus Real Time Open Data is standardized on SIRI (Service Interface for Real Time Information) which is a web based XML protocol to allow distributed computers to exchange real time information about public transport services and vehicles. \u003c/p\u003e\u003cp\u003eSIRI is a CEN technical specification, and is based on the Transmodel abstract model for public transport information, and comprises a general purpose model, and an XML schema for public transport information.\u003c/p\u003e\u003cp\u003eFor more information, see https://en.wikipedia.org/wiki/Service_Interface_for_Real_Time_Information\u003c/p\u003e\u003cp\u003eKolumbus has implemented three SIRI interfaces:\u003c/p\u003e\u003cp\u003eSIRI VM – Vehicle Monitoring (positioning and status for all buses)\u003cbr\u003eSIRI SM – Stop Monitoring (departure prognosis for individual bus stops)\u003cbr\u003eSIRI SX – Situation Exchange (deviation messages)\u003c/p\u003e\u003cp\u003eKolumbus currently support the SIRI version 1.4. \u003c/p\u003e\u003cp\u003eThere are approximately 400 buses that operate and have real-time information in Rogaland.\u003c/p\u003e\u003cp\u003eFor technical developer details and examples, see https://www.kolumbus.no/siri/\u003c/p\u003e"
