  "title": {
    "nb": "Opne datasett frå Lotteri- og stiftelsestilsynet (nynorsk)"
  },
  "description": {
    "nb": "Lotteri- og stiftelsestilsynet kontrollerer norske lotteri og pengespel, og fører tilsyn med norske stiftelsar. I tillegg forvalter vi ordninga med kompensasjon av meirverdiavgift til frivillige lag og organisasjonar, og ulike tilskotsordningar frå Norsk Tippings overskot.Lenka viser til Lotteri- og stiftelsestilsynets nettside for opne data, og data er fordelt på områda: bingo, lotteri, pengespel, tilskot, mva-kompensasjon, hjelpelinjen, stiftelsar"
