  "title": {
    "nb": "Produksjons- og avløsertilskudd til jordbruksforetak – søknadsomgang 2017"
  },
  "description": {
    "nb": "Datasett som inneholder opplysninger fra søknad om og utbetaling av produksjonstilskudd til jordbruksforetak i søknadsomgangen 2017. Opplysningene ble hentet ut i slutten av juni 2018, og datasettet inneholder både søknader som har blitt utbetalt, og søknader som på det tidspunktet var under behandling. For hvert foretak vises organisasjonsnummer, navn, kommunenummer og antall dyr og dekar som er oppført i den enkelte kode i søknadsskjemaet. I tillegg vises beregnet tilskudd per ordning, bunnfradrag, samt sum beregnet tilskudd etter bunnfradrag. Eventuelle andre trekk enn bunnfradrag vises ikke. Søknadsomgangen i 2017 består av to deler:Del 1 – mai:Inneholder søknadsopplysninger om antall dyr på telledato 1. mai.Del 2 – oktober:Inneholder søknadsopplysninger om antall dyr på telledato 1. oktober (inkludert bevaringsverdige husdyrraser), dyr på beite, grønt- og potetproduksjon samt disponerte arealer og hvilke vekster som dyrkes på arealene.Tilskudd for slaktegriser, slaktekyllinger, gjess, kalkuner og ender gis for antall dyr slakta i løpet av søknadsåret, og gis på grunnlag av antall slakta dyr som er rapportert inn fra slakteriene til Leveransedatabasen. Antall slakta dyr inngår ikke i dette datasettet."
  },
  "descriptionFormatted": {
